import React from 'react';
import LOGO from "../images/Ferrari-Scuderia-Symbol.png"


const Header = () => {
  return (
    <div className='header' id='header'>
        <a href='#carousel'><img src={LOGO} alt="logo" className='logo'/></a>

        <div className='navbar' id='nav'>
          <ul>
            <li><a href="#car">Car</a></li>
            <li><a href="https://f1store.formula1.com/en/scuderia-ferrari/t-76758670+z-71034-984427031">Shop</a></li>
            <li><a href="#drivers">Drivers</a></li>
            <li><a href="#about">About</a></li>
            <div id='com'>
            <li><a id='community' href="#community">Community</a></li>
            </div>
          </ul>
        </div>
    </div>
  );
}

export default Header;
